import React, { Component } from 'react';
import Header from './header'
import './userManagement.css'


class UserManagement extends Component{

  componentDidMount(){
    const seedetails = "http://localhost:5000/seeDetails"
    fetch("https://customanager.herokuapp.com/seeDetails").then(res => {
              if (res.ok) {
                return res.json();
              } else {
                throw Error(res.statusText);
              }
            })
            .then(json => this.setState({ data: json }))
        .catch( err => console.log(err))




  }

  SeeDetails = () => {
  const Data = this.state.data.map((customer) => {
      return <>
      <tr>
        <td>{customer._id}</td>
        <td>{customer.name}</td>
        <td>{customer.ph}</td>
        <td>{customer.address}</td>
        <td>{customer.verified}</td>
      </tr>
      </>
  })
  return Data;
  }

  render(){
    return <>
    <Header />
    <div className='container text-center'>
    <div className='card d1 container'>
    <button className='btn   text d2'>ADD USER</button>

    <table>
    <tr>
      <th>Customer ID</th>
      <th>Customer Name</th>
      <th>Phone Number</th>
      <th>Address</th>
      <th>Verified</th>
    </tr>
    {this.SeeDetails()}
  </table>
    </div>
    </div>
    </>
  }
}

export default UserManagement;
